export default function LaunchPanel({ launchData }) {

    console.log(launchData);
    const x = launchData.map(function(singleData) {
        return (
            <div>
                Mission Name: {singleData.mission_name} #{singleData.flight_number}
                Launch Year: {singleData.launch_year}
                Successful Launch: {singleData.launch_success}
                Successful Landing: {singleData.launch_success}
            </div>
        );
    })
    console.log(x)

    return (
        <div>
            {x}
        </div>
    );
}
